import React from 'react';
import PropTypes from 'prop-types';

const foodILike = [
  {
    id:1,
    rating:5,
    name : "chicken",
    image : "https://dinnerthendessert.com/wp-content/uploads/2018/04/Sesame-Chicken-3-1048x1572.jpg"
  },
  {
    id:2,
    rating:4.9,
    name : "salmon",
    image : "https://www.spendwithpennies.com/wp-content/uploads/2020/01/Baked-Salmon-SpendWithPennies-3.jpg"
  },
  {
    id:3,
    rating:4.8,
    name : "beer",
    image : "https://shanghai-paper.com/wp-content/uploads/2020/06/Beer-in-China.jpg"
  },
  {
    id:4,
    rating:4.7,
    name : "kimchi",
    image : "https://recipe1.ezmember.co.kr/cache/recipe/2017/07/20/aef5e38149c2425ab2d10314c407f95f1.jpg"
  },
  {
    id:5,
    rating:4.6,
    name : "bread",
    image : "https://www.melskitchencafe.com/wp-content/uploads/french-bread1-500x749.jpg"
  },


]



function Food({ name, picture, rating }) {
  return (
    <div>
      <h3>I like {name}</h3>
      <h4>{rating}/5.0</h4>
      <img src={picture} alt = {name} />
    </div>

  );
}
Food.propTypes = {
  name : PropTypes.string.isRequired,
  picture : PropTypes.string.isRequired,
  rating:PropTypes.number.isRequired
}


function App() {
  return (
    <div>
     {foodILike.map(dish => (
       <Food 
        key={dish.id}
        name={dish.name}
        picture={dish.image}
        rating={dish.rating}
      />
     ))}

    </div>
  );
}

export default App;
